import React from 'react';
import {Link, NavLink} from "react-router-dom";

const Navbar = () => {

    return (
        <div className="navBar">
            <div className="cvalogo">
                <Link to="/" id="ket">CVA Ketenzorg</Link>
            </div>

            <div className="navblock">
                <nav className="navButtons">
                    <ul>
                        <li><NavLink to="/Begeleiding" id="beg">Begeleiding</NavLink></li>
                        <li><NavLink to="/Professionals" id="pro">Professionals</NavLink></li>
                        <li><NavLink to="/Informatie" id="info">Informatie</NavLink></li>
                        <li><NavLink to="/Contact" id="cont">Contact</NavLink></li>
                    </ul>
                </nav>
            </div>
        </div>
    )
}

export default Navbar;
